private void parseFilters(StringBuilder select, QueryDataSource d, Set<String> tags) {
    select.append(" where `period` <= ? and `period` >= ?");
    List<Object> params = new ArrayList<>();
    params.add(d.end);
    params.add(d.start);
    if (!CollectionUtils.isEmpty(d.filters)) {
        for (QueryFilter filter : d.filters) {
            if (!tags.contains(filter.name)) {
                continue;
            }
            switch (filter.type) {
                case "literal_or":
                    select.append(" and `").append(filter.name).append("` in (");
                    String[] values = filter.value.split("\\|");
                    for (int i = 0; i < values.length; i++) {
                        if (i > 0) {
                            select.append(",");
                        }
                        select.append("?");
                        params.add(values[i]);
                    }
                    select.append(")");
                    break;
                // ... other cases ...
            }
        }
    }
    // Execute the query with the parameters
    // ...
}

