private String transformCondition(String columnName, String value) {
    switch (columnName) {
        case "empno":
        case "sal":
        case "comm":
        case "deptno":
            return columnName + " = " + value;
        case "ename":
        case "job":
            return columnName + " like '%" + value + "%'";
        case "hiredate":
            return "to_char(" + columnName + ",'yyyy-mm-dd') = '" + value + "'";
        default:
            return null;
    }
}

private String transformCondition(String columnName, String value) {
    switch (columnName) {
        case "empno":
        case "sal":
        case "comm":
        case "deptno":
            return columnName + " = ?";
        case "ename":
        case "job":
            return columnName + " like ?";
        case "hiredate":
            return "to_char(" + columnName + ",'yyyy-mm-dd') = ?";
        default:
            return null;
    }
}

